【スーパーワイヤレスメガホン(防滴)】<br>
<br>
●ワイヤレスチューナー内蔵モデル。サイレン付。<br>
●防水性能がIPX5（本体）ですので突然の激しい雨でも安心です。大出力メガホンでの防滴構造は業界初。<br>
●従来のスーパーメガホンよりも幅と長さが短くなって重量バランスも優れています。女性にも持ち運びしやすくなりました。<br>
●デジタルアンプの採用で省エネ化。従来のスーパーメガホンは単1形乾電池10本必要でしたが、TWBシリーズは単1形乾電池8本でご使用頂けます。<br>
●LD-300（別売）でDC12V（カーバッテリー等）から電源を取ることができます。<br>
●付属の有線マイクロホンの他、ワイヤレスマイクロホン（WM-3000A,3400,3100,3120）が使用可能。<br>
●空きスロットが1つありますので、別売のワイヤレスチューナーユニット（SU-350・DU-850A）もしくはSDレコーダーユニット（SDU-300）を増設することができます。<br>
●SU-350増設時は300MHz帯ワイヤレスマイクロホン（WM-3000A,3400,3100,3120）を1本、DU-850A増設時は800MHz帯ワイヤレスマイクロホン（WM-8400,8240,8030A,8130A,8100A,8330A）を1本追加でご使用頂けます。<br>
●SDレコーダーユニット（SDU-300）は多彩な再生モードを用意。本体で録音も可能です。<br>
●外部入力端子を活用すれば最大4本（有線×2 & ワイヤレス×2）のマイクを同時使用可能です。<br>
●別売のスピーカースタンドST-22に取付けて使用できます。<br>
<br>
使用電源：単1形乾電池 8本<br>
外部電源使用電圧範囲：DC10V～16V（12Vバッテリー）<br>
出力：（最大）45W　（定格）30W<br>
通達距離：（音声）約800m （サイレン）約1000m [JEITA]<br>
電池持続時間：（音声）約22時間 （サイレン）約2時間[JEITA]<br>
外部入力：1系統（マイク入力・AUX入力の感度切換付）<br>
外形寸法：幅218mm 高さ371（343）mm 奥行350mm ※（）内はハンドル、突起部を含まない寸法<br>
質量：約4.1kg（乾電池を除く）<br>
<br>

